- /wp:group -->\n\n<!-- wp:heading {\"level\":3,\"fontSize\":\"large\"} -->\n<h3 class=\"wp-block-heading has-large-font-size\">Commitment to sustainability</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>At the heart of our mission is a commitment to sustainability. We prioritize environmentally friendly practices by sourcing locally grown produce, minimizing packaging waste, and championing sustainable farming methods.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"spacing\":{\"margin\":{\"bottom\":\"10px\"}}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\" style=\"margin-bottom:10px\"><!-- wp:image {\"id\":273,\"aspectRatio\":\"4/3\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/44024b9b9c88dd50f5cf11f5c31311c5-1.jpeg\" alt=\"\" class=\"wp-image-273\" style=\"aspect-ratio:4/3;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:heading {\"level\":3,\"fontSize\":\"large\"} -->\n<h3 class=\"wp-block-heading has-large-font-size\">Quality and freshness</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Every step of our process, from meticulous ingredient selection to adhering to stringent standards, reflects our dedication to quality. From the initial harvest to the finished product, we uphold uncompromising standards of freshness and flavor.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap